create table MOCK_DATA (
	event_id VARCHAR(40),
	title TEXT,
	description TEXT,
	status VARCHAR(9),
	date DATE,
	time VARCHAR(50),
	follow_up TEXT,
	other_details VARCHAR(50),
	location_id VARCHAR(50),
	category_id VARCHAR(50),
	client_id VARCHAR(50),
	created_by VARCHAR(50),
	created_at DATE,
	modified_by VARCHAR(50),
	modified_at DATE
);
